// resetpass.js (assuming this is the file where resetpass function is defined)

import axios from 'axios';
const baseURL = 'http://localhost:3001/users'; // Thay thế bằng URL API thực tế của bạn

const resetpass = async (username, password, email) => {
  try {
    const newUser = {
      username: username,
      password: password,
      email: email
    };

    const response = await axios.post(`${baseURL}/repass`, newUser);
    return response.data; // Return response.data if you need the data part of the response

  } catch (error) {
    console.error('Error resetting password:', error);
    throw error; // Throw error for handling elsewhere
  }
};

export default resetpass;
